(1, '仁信支付', 'halupay.com', '', '仁信支付 安全稳定', '仁信支付、支付平台、仁信支付平台、聚合支付、微信支付、支付宝支付、网银支付、银联支付、支付接口、支付通道、安能第三方支付', '仁信支付要服务于互联网和移动互联网领域，为网页游戏、手机游戏、阅读、音乐、视频、交友、教育等移动应用提供综合支付营销服务。', 'service@anepay.com', '400-869-3656', '87456887', '上海天旸信息科技有限公司', '沪ICP备13008591号', '', 'smtp.163.com', 'yuyangapple@163.com', 'yaoxufang1989', 0, 0, 23, '允许提现时间为17点至23点，其他时间提现暂时关闭。', 2, '每日限提现2次', 1, 0, '', '', 1, 25, 0);
